        <Router>
        <div className="App">
          {/* Routes */}
          <Switch>
            <Route exact path="/">
              <Signup></Signup>
            </Route>
            <Route exact path="/Login">
              <Login></Login>
            </Route>
            <Route exact path="/Home">
              <Home></Home>
            </Route>
            <Route exact path="/Main_user">
              <Main_user></Main_user>
            </Route>
            <Route exact path="/Profile">
              <Profile></Profile>
            </Route>
          </Switch>
        </div>
      </Router>
      );
    }
}
export default App;
